description:
Verenigde Staten
Avontuur
118 minuten

een leuke film

met Jesse James, Reiley McClendon en Stephen Baldwin

Jason en Kyle zijn twee beste vrienden die vaak te vinden zijn op een plaatselijk vliegveldje. Als de twee een mysterieus 
vliegtuig ontdekken, besluiten ze uit nieuwsgierigheid aan boord te gaan. Als ook twee onbekende mannen het vliegtuig betreden 
verstoppen ze zichzelf, maar komen ze er ook achter dat er beweging in het vliegtuig komt. Voordat ze het weten vliegen ze boven 
de woestijn van Arizona en begint het avontuur...
